import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import { BrowserRouter } from "react-router-dom";
import state from "./redux/state";
import {addPosts} from "./redux/state";

ReactDOM.render(
    <BrowserRouter>
        <App state={state} />
    </BrowserRouter>,
    document.getElementById("root")
);
